import React from 'react';
import projects from '../assets/projects';

export default function Portfolio() {
  return (
    <Container className="main">
      <Header page={'Portfolio'} />
      <CardColumns className="pb-5 pt-5">
        {projects.map((project) => (
          <Project
            name={project.name}
            src={project.src}
            git={project.git}
            live={project.live}
          />
        ))}
      </CardColumns>
      <Footer />
    </Container>
  );
}
